import { memo, useState, useEffect } from 'react'
import { Sidebar, Menu as MenuSide, MenuItem as MenuItemSide, SubMenu, useProSidebar } from 'react-pro-sidebar';
import { englishAdminMenu, vietnameseAdminMenu } from '../../Languages/AdminMenu';

function AdminHome({ languageSelected }) {
    let adminMenuLabel = (languageSelected === 'EN' ? englishAdminMenu : vietnameseAdminMenu)

    return (
        <div className='container home-main'>
            <div className='home-partner-main d-flex'>
                <Sidebar className='menu-sidebar'>
                    <MenuItemSide>{adminMenuLabel.txtDashboard}</MenuItemSide>
                    <MenuSide>
                        <SubMenu>
                            <MenuItemSide>{adminMenuLabel.txtAccommodation}</MenuItemSide>
                            <MenuItemSide>{adminMenuLabel.txtEntertainment}</MenuItemSide>
                            <MenuItemSide>{adminMenuLabel.txtRestaurant}</MenuItemSide>
                        </SubMenu>
                        <MenuItemSide> Documentation </MenuItemSide>
                        <MenuItemSide> Calendar </MenuItemSide>
                    </MenuSide>
                </Sidebar>
                <div className='container list-service-main'>setAddress</div>
            </div>
        </div>
    )
}

export default memo(AdminHome)
